import { useRef } from "react";
import { FaBars, FaTimes } from "react-icons/fa";

function Navbar() {
    const navRef = useRef(); 

    return (
        <header>
            <h3>Logo</h3>
            <nav>
                <a href="/#">About</a>
                <a href="/#">Resume</a>
                <a href="/#">Contact</a>
                <button>
                    <FaTimes/>
                </button>
            </nav>
            <button>
                <FaBars/>
            </button>
        </header>

    ); 
}

export default Navbar;
